import React, { useState, useEffect } from 'react';
import './App.css';
import { Clock } from 'lucide-react';

const GRID_WIDTH = 20;
const GRID_HEIGHT = 10;
const BOX_SIZE = 70;
const EMOJI_SIZE = 40;
const [isPaused, setIsPaused] = useState(false);


export default function App() {
  const [gameState, setGameState] = useState({
    beast: [0, 0],
    engineers: [],
    walls: []
  });

  const [elapsedTime, setElapsedTime] = useState(0);

  const togglePause = () => {
    setIsPaused(prev => !prev);
};

  useEffect(() => {
    const startTime = Date.now();
    const fetchGameState = async () => {
      try {
        const response = await fetch('http://localhost:5000/update');
        const data = await response.json();
        setGameState(data);
        setElapsedTime(Math.floor((Date.now() - startTime) / 1000));
      } catch (error) {
        console.error('Error fetching game state:', error);
      }
    };

    fetchGameState();
    const intervalId = setInterval(fetchGameState, 1000);

    return () => clearInterval(intervalId);
  }, []);

  const formatTime = (seconds) => {
    const mins = Math.floor(seconds / 60);
    const secs = seconds % 60;
    return `${mins.toString().padStart(2, '0')}:${secs.toString().padStart(2, '0')}`;
  };

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-900 text-white p-8">
      <h1 className="text-4xl font-bold mb-8">Beast Hunt Game</h1>
      <button 
            className="mb-4 p-2 bg-blue-600 rounded"
            onClick={togglePause}
        >
            {isPaused ? 'Resume' : 'Pause'}
        </button>
      {/* Flex container with flexible columns */}

        {/* Game Board */}
        <div
          className="game-board flex-grow"
          style={{
            display: 'grid',
            gridTemplateColumns: `repeat(${GRID_WIDTH}, ${BOX_SIZE}px)`,
            gridTemplateRows: `repeat(${GRID_HEIGHT}, ${BOX_SIZE}px)`,
            gap: '1px',

            padding: '10px',
            borderRadius: '8px',
            boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
          }}
        >
          {Array.from({ length: GRID_WIDTH * GRID_HEIGHT }).map((_, index) => {
            const x = index % GRID_WIDTH;
            const y = Math.floor(index / GRID_WIDTH);
            let content = '';
            let bgColor = '#4a5568';
            let initials = '';

            if (gameState.beast[0] === x && gameState.beast[1] === y) {
              content = 'ðŸ‘¹';
              initials = 'Beast';
            } else {
              const engineer = gameState.engineers.find(
                (eng) => eng.position[0] === x && eng.position[1] === y
              );
              if (engineer) {
                content = engineer.emoji;
                initials = engineer.name; // Use the engineer's name or initials
              }
            }

            return (
              <div
                key={index}
                style={{
                  width: BOX_SIZE,
                  height: BOX_SIZE,
                  backgroundColor: bgColor,
                  display: 'flex',
                  flexDirection: 'column', // Stack emoji and initials
                  justifyContent: 'center',
                  alignItems: 'center',
                  fontSize: `${EMOJI_SIZE}px`,
                }}
              >
                <span>{content}</span> {/* Emoji */}
                <span style={{ fontSize: '12px' }}>{initials}</span> {/* Initials or name */}
              </div>
            );
          })}

        </div>

        {/* Game Info Table */}
        <div className="game-info flex-grow">
          <div className="mb-4 flex items-center">
            <Clock className="mr-2" />
            <span className="text-xl">{formatTime(elapsedTime)}</span>
          </div>
          <table className="table-auto border-collapse w-full">
            <thead>
              <tr>
                <th className="px-4 py-2">Entity</th>
                <th className="px-4 py-2">Position</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td className="border px-4 py-2">ðŸ‘¹ Beast</td>
                <td className="border px-4 py-2">
                  ({gameState.beast[0]}, {gameState.beast[1]})
                </td>
              </tr>
              {gameState.engineers.map((engineer, index) => (
                <tr key={index}>
                  <td className="border px-4 py-2">
                    {engineer.emoji} {engineer.name}
                  </td>
                  <td className="border px-4 py-2">
                    ({engineer.position[0]}, {engineer.position[1]})
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
  );
}
